'use strict';

var SocialNetwork = angular
    .module('SocialNetwork', ['ngRoute', 'ngResource', 'ngAnimate', 'ngStorage', 'naif.base64', 'toaster', 'chieffancypants.loadingBar'])
    .config(function ($routeProvider) {
        $routeProvider
            .when('/', {
                templateUrl: 'templates/home.html',
                controller: 'mainController'
            })
            .when('/login', {
                templateUrl: 'templates/guest/login.html',
                controller: 'LoginController',
                resolve:{
                    isLogged: function($location, $sessionStorage){
                        if($sessionStorage.authorization){
                            $location.path('/');
                        }
                    }
                }

            })
            .when('/register', {
                templateUrl: 'templates/guest/register.html',
                controller: 'RegisterController',
                resolve:{
                    isLogged: function($location, $sessionStorage){
                        if($sessionStorage.authorization){
                            $location.path('/');
                        }
                    }
                }
            })
            .when('/logout', {
                templateUrl: 'templates/logged/logout.html',
                controller: 'LogoutController',
                resolve:{
                    isNotLogged: function($location, $sessionStorage){
                        if(!$sessionStorage.authorization){
                            $location.path('/');
                        }
                    }
                }
            })
            .when('/profile', {
                templateUrl: 'templates/logged/edit-profile.html',
                controller: 'EditProfileController',
                resolve:{
                    isLogged: function($location, $sessionStorage){
                        if(!$sessionStorage.authorization){
                            $location.path('/');
                        }
                    }
                }
            })
            .when('/profile/password', {
                templateUrl: 'templates/logged/change-password.html',
                controller: 'ChangePasswordController',
                resolve:{
                    isLogged: function($location, $sessionStorage){
                        if(!$sessionStorage.authorization){
                            $location.path('/');
                        }
                    }
                }
            })
            .when('/users/:username', {
                templateUrl: 'templates/post/wall.html',
                controller: 'UserWallController',
                resolve:{
                    isLogged: function($location, $sessionStorage){
                        if(!$sessionStorage.authorization){
                            $location.path('/');
                        }
                    }
                }
            })
            .otherwise({
                redirectTo: '/'
            })
    })
    .constant(
    {
        'baseUrl': 'http://softuni-social-network.azurewebsites.net/api/',
        'defaultProfileImageData': 'data:image/jpg;base64,',
        'defaultCoverImageData': 'data:image/jpg;base64,'
    });
